import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

import { StyleSheet, Text, Image } from 'react-native';

class Landing extends Component {
    render() {
      return(
      <BackgroundImage>
              <Text style={styles.text}>Fullscreen!</Text>



        <div style={{width: '100%', margin: 'auto'}}>
          <Grid className="landing-grid">
            <Cell col={12}>

              <div className="banner-text" >
                <h1>Full Stack Web Developer</h1>

              <hr/>

            <p>HTML/CSS |  JavaScript | React |  Gatsby  |  NodeJS </p>

          <div className="social-links">

            {/* LinkedIn */}
            <a href="https://www.linkedin.com/in/rusilah-gojali/" rel="noopener noreferrer" target="_blank">
              <i className="fa fa-linkedin-square" aria-hidden="true" />
            </a>

            {/* Github */}
            <a href="https://github.com/rgojali" rel="noopener noreferrer" target="_blank">
              <i className="fa fa-github-square" aria-hidden="true" />
            </a>

          </div>
              </div>
            </Cell>
          </Grid>
        </div>

        </BackgroundImage>
      )
    }
  }

  export default Landing;


class BackgroundImage extends Component {

    render() {
        return (
            <Image source={require('background.png')}
                  style={styles.backgroundImage}>

                  {this.props.children}

            </Image>
        )
    }
}


const styles = StyleSheet.create({
    backgroundImage: {
        flex: 1,
        width: null,
        height: null,
        resizeMode: 'cover'
    },

    text: {
        textAlign: 'center',
        color: 'white',
        backgroundColor: 'rgba(0,0,0,0)',
        fontSize: 32
    }
});
